description:
Kubuntu 14.04.1 32-bit maintenance release


MD5: 327cf4202f8e2601ce0d772082c84b86


Iain Lane has announced the availability of the second alpha release of Ubuntu 14.10, code-named &quot;Utopic Unicorn&quot;. As with the first alpha, only Kubuntu, Lubuntu, Ubuntu GNOME and Ubuntu Kylin have opted to release CD/DVD images for testing. From the release announcement: &quot;The second alpha of the Utopic Unicorn (to become 14.10) has now been released. This alpha features images for Kubuntu, Lubuntu, Ubuntu GNOME, Ubuntu Kylin and the Ubuntu Cloud images. Alpha 2 includes a number of software updates that are ready for wider testing. This is quite an early set of images, so you should expect some bugs. A big thank you to the developers and testers for their efforts to pull together this alpha release!&quot;
